import React, { useState } from 'react';
import { BrowserRouter, Route, useHistory } from 'react-router-dom';
import TareaCreada from './TareaCreada';

const CrearTareas = () => {
    const [nombreTarea, setNombreTarea] = useState('');

    const history = useHistory();

    const handleInputChange = (event) => {
        setNombreTarea(event.target.value);
    };

    const handleSubmit = (event) => {
        event.preventDefault();

        if (nombreTarea.trim() === '') {
            alert('Por favor, ingresa un nombre para la tarea.');
            return;
        }

        console.log('Nombre de la tarea:', nombreTarea);

        setNombreTarea('');

        history.push(`/tarea-creada/${nombreTarea}`);
    };

    return (
        <BrowserRouter>
            <div>
                <h1>Crear Nueva Tarea</h1>
                <form onSubmit={handleSubmit}>
                    {/* Resto del c√≥digo */}

                </form>
            </div>

            <Route path="/tarea-creada/:nombreTarea" render={({ match }) => (
                <TareaCreada nombreTarea={match.params.nombreTarea} />
            )} />
        </BrowserRouter>
    );
};

export default CrearTareas;
